import React from 'react';
import Header from './Header';
import Axios from 'axios';



class HeaderContainer extends React.Component {
    
    componentDidMount() {
        Axios.get('')
    }
    
    render() {
        return <Header {...this.props} />
    }
}


export default HeaderContainer;
